import React, { useState } from 'react';
import './Aircraft.css';

const Aircraft = () => {
  const [aircraftList, setAircraftList] = useState([
    {
      id: 1,
      registration: 'VH-ABC',
      type: 'C172',
      maintenanceStatus: 'Serviceable',
      totalHours: 5000,
      nextService: 5100,
    }
  ]);

  const [selectedAircraft, setSelectedAircraft] = useState(null);

  const handleAircraftUpdate = (updatedAircraft) => {
    setAircraftList(aircraftList.map(aircraft => 
      aircraft.id === updatedAircraft.id ? updatedAircraft : aircraft
    ));
  };

  const handleAddAircraft = () => {
    const newAircraft = {
      id: Date.now(),
      registration: '',
      type: '',
      maintenanceStatus: 'Serviceable',
      totalHours: 0,
      nextService: 100,
    };
    setAircraftList([...aircraftList, newAircraft]);
    setSelectedAircraft(newAircraft);
  };

  return (
    <div className="page-container">
      <div className="page-header">
        <h1>Aircraft Management</h1>
      </div>
      <div className="content-container">
        <div className="aircraft-container">
          <div className="aircraft-list">
            <h2>Aircraft List</h2>
            <button onClick={handleAddAircraft}>Add New Aircraft</button>
            {aircraftList.map(aircraft => (
              <div 
                key={aircraft.id} 
                className={`aircraft-item ${selectedAircraft?.id === aircraft.id ? 'selected' : ''}`}
                onClick={() => setSelectedAircraft(aircraft)}
              >
                {aircraft.registration} - {aircraft.type}
              </div>
            ))}
          </div>
          
          {selectedAircraft && (
            <div className="aircraft-details">
              <h2>Aircraft Details</h2>
              <form>
                <div className="form-group">
                  <label>Registration:</label>
                  <input
                    type="text"
                    value={selectedAircraft.registration}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      registration: e.target.value
                    })}
                  />
                </div>
                
                <div className="form-group">
                  <label>Type:</label>
                  <input
                    type="text"
                    value={selectedAircraft.type}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      type: e.target.value
                    })}
                  />
                </div>

                <div className="form-group">
                  <label>Maintenance Status:</label>
                  <select
                    value={selectedAircraft.maintenanceStatus}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      maintenanceStatus: e.target.value
                    })}
                  >
                    <option value="Serviceable">Serviceable</option>
                    <option value="Unserviceable">Unserviceable</option>
                    <option value="Maintenance">In Maintenance</option>
                  </select>
                </div>

                <div className="form-group">
                  <label>Total Hours:</label>
                  <input
                    type="number"
                    value={selectedAircraft.totalHours}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      totalHours: parseFloat(e.target.value)
                    })}
                  />
                </div>

                <div className="form-group">
                  <label>Next Service Due:</label>
                  <input
                    type="number"
                    value={selectedAircraft.nextService}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      nextService: parseFloat(e.target.value)
                    })}
                  />
                </div>
              </form>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Aircraft;
